;; gorilla-repl.fileformat = 2

;; **
;;; # PinkGorilla Demo  gg4clj (ggplot charts via R)
;;;  
;;; pinkgorilla.ui.gg4clj uses R under the hood. So R needs to be installed on the machine that runs pinkgorilla repl.
;; **

;; **
;;; 
;;; # Debian R installation guide 
;;; 
;;; ** Install R **
;;; ```
;;;   Add this line to /etc/apt/sources:
;;;   sudo nano /etc/apt/sources.list
;;;   deb http://cran.wustl.edu/linux/debian buster-cran35/
;;; 
;;;   sudo apt-get update
;;;   sudo apt-get install r-recommended
;;; ```
;;; 
;;; **Inside R: install ggplot2**
;;; because it will install dependencies globally it needs to be run as sudo
;;; sudo R
;;; ```
;;;  install.packages("ggplot2")
;;;  install.packages("svglite")
;;;  q()
;;;  ```
;;; 
;;; ** Check if Rscript works **
;;; Rscript is needed by gorilla r-wrapper
;;; ```
;;; Rscript
;;; ```
;; **

;; @@
; ADD DEPENDENCY
(use '[pinkgorilla.helper])
(pinkgorilla.helper/add-dependencies '[pinkgorilla.ui.gg4clj "0.1.9"])
